shaders.vertex:
attribute vec4 aVertex;
attribute vec4 aTexCoord;
varying vec4 vTexCoord;

void main(void)
{
    vTexCoord = aTexCoord;
    gl_Position = aVertex;
}

shaders.fragment:
varying vec4 vTexCoord;
uniform sampler2D uTexture;
uniform float uT;
uniform vec2 uResolution;
uniform vec2 uMouse;
uniform float uRShift; // -1, 1, -0.03
uniform float uGShift; // -1, 1, -0.46
uniform float uBShift; // -1, 1,  0.18
uniform bool uInvert; // false

void main(void)
{
  vec2 mouse = uMouse / uResolution;
  float grey1 = dot(texture2D(uTexture, vec2(uRShift, 0.0) + vTexCoord.st).rgb, vec3(0.299, 0.587, 0.114));
  float grey2 = dot(texture2D(uTexture, vec2(uGShift, 0.0) + vTexCoord.st).rgb, vec3(0.299, 0.587, 0.114));
  float grey3 = dot(texture2D(uTexture, vec2(uBShift, 0.0) + vTexCoord.st).rgb, vec3(0.299, 0.587, 0.114));
  vec3 rgb = vec3(grey1, grey2, grey3);
  if (uInvert)
    rgb = vec3(1.0) - rgb;
  gl_FragColor = vec4(rgb, 1.0);
}
